import React from 'react';
import { Link } from 'react-router-dom'
import './navbar.css';

const Navbar = () => {
    return ( 
        <div>
            <nav>
                <h3>Customer Relationship Management</h3>
                <Link to='/'>Dashboard</Link>
                <Link to='/customer'>New Customer</Link>
                <Link></Link>
            </nav>
        </div>
    );
}

export default Navbar;
